    numMax=parseInt(numMax);
    return Math.round(Math.random() * (numMax - numMin) + numMin);
  },

  tarjetaCredito: function({tipo="cualquiera"}){
    let part1;
    switch (tipo) {
      case "cualquiera":
        part1=Math.round(Math.random() * (6000 - 4000) + 4000);
        break;
      case "visa":
        part1=Math.round(Math.random() * (5000 - 4000) + 4000);
        break;
